import styled from 'styled-components';

export const HeroContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 30px;
  height: 800px;
  position: relative;
  z-index: 1;

  /* Add :before styles */
`;

export const HeroBg = styled.div`
  display: flex;
  justify-content: center;
  height: 100%;
  overflow: hidden;
  /* background-color: red; */
`;
